== KALIUM ==
Kalium, juga dikenal sebagai potasium, adalah salah satu elemen kimiawi berupa logam alkali. Kalium amat diperlukan pada semua bentuk kehidupan, baik tumbuhan dan hewan, termasuk manusia. Kalium dalam tubuh merupakan kation ''intraseluler'' dominan, yang berperan penting dalam fungsi tubuh normal. Sumber kalium dalam [http://www.kerjanya.net/faq/10805-diet.html diet] terdapat pada makanan jenis biji  bijian, daging, kacang  kacangan, buah, serta sayuran hijau. Asupan harian rata  rata yang dianjurkan pada populasi umum, adalah sebagai berikut: bayi usia 0  6 bulan 400 mg/hari, bayi usia 7  12 bulan 700 mg/hari, anak usia 1  3 tahun 3.000 mg/hari, anak usia 4  8 tahun 3.800 mg/hari, anak usia 9  13 tahun 4.500 mg/hari, usia 14 tahun serta [http://www.kerjanya.net/faq/10725-ibu-hamil.html ibu hamil] 4.700 mg/hari, dan ibu menyusui 5.100 mg/hari. Kadar normal kalium dalam darah pada orang dewasa berkisar antara 3,5  5 mEq/L atau 3,5  5 mmol/L.

== FUNGSI ==
Kalium berperan penting dalam fungsi tubuh normal, berikut adalah beberapa fungsi dari kalium pada tubuh:
* Fungsi biokimia. Kalium berperan penting dalam fungsi sistem saraf, serta berperan terhadap keseimbangan tekanan osmotik antara cairan di dalam sel (''intrasel'') dengan cairan pada ruang antar sel (''interstitial''), yang dimediasi oleh oleh suatu mekanisme yang disebut sebagai pompa Na<sup>+</sup>/K<sup>+</sup>-ATPase.
* Polarisasi membran. Kalium berperan dalam kerja otot serta penghantaran seluruh impuls saraf melalui potensial aksi. Rendahnya kadar kalium dalam serum darah dapat menyebabkan suatu kondisi yang mengancam jiwa, kondisi tersebut dapat disebabkan oleh [http://www.kerjanya.net/faq/4779-diare.html diare], muntah, dan atau peningkatan frekuensi berkemih.
* Filtrasi dan ekskresi. Kalium bersama dengan natrum dan calsium berperan dalam regulasi proses filtrasi serta ekskresi cairan dan mineral pada tubuh manusia.

== KELAINAN ==
Kondisi gangguan keseimbangan kalium berupa rendahnya kadar kalium dalam tubuh, kususnya dalam darah, dikenal sebagai ''hipokalemia''. Sebaliknya, jika kadar kalium dalam darah lebih tinggi dari normal, kondisi ini dikenal sebagai ''hiperkalemia''. Kedua kondisi tersebut dapat menyebabkan gangguan  gangguan pada fungsi tubuh, kadang gangguan tersebut dapat mengancam jiwa.

''Hipokalemia'' secara umum didefinisikan sebagai kadar kalium serum 3,5 mEq/L. Sedangakan ''hipokalemia'' berat didefinisikan sebagai kadar kalium serum 2,5 mEq/L yang berpotensi untuk menyebabkan kematian. Gejala ''hipokalemia'' tidak spesifik dan terutama berkaitan dengan fungsi otot rangka adan [http://www.kerjanya.net/faq/10831-jantung.html jantung]. Gejala yang dapat timbul mencakup:
* Kelemahan dan kelelahan otot (paling umum);
* Kram dan nyeri otot (kasus berat);
* Memburuknya kontrol [http://www.kerjanya.net/faq/10737-diabetes.html diabetes];
* Jantung berdebar - debar;
* Gejala psikologis (psikosis, delirium, halusinasi, [http://www.kerjanya.net/faq/11051-depresi.html depresi]);
* Penurunan denyut jantung;
* Gangguan irama denyutjantung;
* Henti nafas.
''Hiperkalemia'' didefinisikan sebagai kadar serum kalium 5,5 mEq/L (usia dewasa), sedangkan kisaran pada bayi dan anak tergantung dari usia. Pada kadar kalium serum >7 mEq/L, kondisi tersebut dapat menyebabkan gangguan pada sistem jantung dan pembuluh darah serta gangguan pada sistem saraf yang signifikan, sedangkan jika kadar mencapai >8,5 mEq/L, kondisi tersebut dapat menyebabkan henti nafas atau henti jantung dan berakhir dengan kematian. Pada kasus ringan, gejala yang dapat timbul berupa:
* Kelemahan dan kelumpuhan (paling umum);
* [http://www.kerjanya.net/faq/5319-dispnea-sesak.html Sesak] nafas;
* Jantung berdebar - debar;
* Nyeri dada;
* Mual dan muntah;
* Sensasi terbakar atau kesemutan ([http://www.kerjanya.net/faq/5093-parestesia.html parestesia]).

